import React, { useEffect, useState ,useRef} from 'react';

const Ajout = () => {

   
    const [listeJury,setJury]=useState([
        { nomjury:"vide" }
     ]);
    
     const inputAnnee=useRef();

  const handleChange=(e,i)=>{
        const {name,value}=e.target;
        const list=[...listeJury];
        list[i][name]=value;
            setJury(list);
       
   };

   const handleAddJury=()=>{
        setJury([...listeJury,{nomjury:"vide"}]);
   };

   const handleDeleteJury=(i)=>{
    const list=[...listeJury];
    const temp=[];
        list.map((jury,index)=>
        {
            if(index!=i)
            {
                temp.push(jury);
            }
            
        })
        setJury(temp);
   };

        const handleSubmit=(e)=>
        {
            e.preventDefault();
            console.log(inputAnnee.current.value);
        }

        useEffect(()=>
        {
            console.log(inputAnnee);
        },[])


    return (

                <div className="col-10">
                RESULTAT
            <form onsSubmit={handleSubmit}>
                <div className="form-floating mb-3 primary">
                    <input type="number" className="form-control" ref={inputAnnee} placeholder="name@example.com"/>
                    <label htmlFor="floatingInput">Annee</label>
                </div>
                <div className="form-floating">
                    <input type="text" className="form-control" id="floatingPassword" placeholder="Password"/>
                    <label htmlFor="floatingPassword">Code Document</label>
                </div>
                <br />
                <div className="form-floating">
                    <input type="text" className="form-control" id="floatingPassword" placeholder="Password"/>
                    <label htmlFor="floatingPassword">Code Instition</label>
                </div>
                <br />
                <div className="mb-3">
                    <label htmlFor="formFile" className="form-label">Choisir un fichier PDF</label>
                    <input className="form-control" type="file" id="formFile"/>
                </div>

                <br />
                <div className="form-floating">
                    <input type="text" className="form-control" id="floatingPassword" placeholder="Password"/>
                    <label htmlFor="floatingPassword">Auteur</label>
                </div>
                <br />
               
                <div className="container overflow-hidden">
                    <div className="row gx-5">
                        <div className="col">
                       
                                        <h3> JURY</h3>
                                        
                       
                            {listeJury.map((jury,index)=>
                            {
                                return(
                                    <div className="input-group  mb-2" key={index}>
                                    <input type="text" 
                                    className="form-control" 
                                    placeholder="Jury"
                                    name="nomjury"
                                    value={jury.nomjury} 
                                    onChange={e=>handleChange(e,index)}
                                    />       
                                     <br />
                                   
                                    {listeJury.length>1 && <button className="btn btn-outline-secondary" type="button"  onClick={()=>handleDeleteJury(index)}>Supprimer</button>} 
                                 </div>
                                   
                                )
                              
                            })}
                                <button className="btn btn-outline-secondary" type="button" onClick={handleAddJury}>Ajouter</button>
                            
                        </div>

                    </div>
                    </div>
                    <br />

                    <div className="form-floating mb-3 primary">
                        <input type="text" className="form-control" id="floatingInput" placeholder="name@example.com"/>
                        <label htmlFor="floatingInput">Directeur du these</label>
                     </div>
                <br />

                <div className="form-floating mb-3 primary">
                        <input type="text" className="form-control" id="floatingInput" placeholder="name@example.com"/>
                        <label htmlFor="floatingInput">Titre</label>
                     </div>
                <br />

                <div className="form-floating mb-3 primary">
                        <input type="date" className="form-control" id="floatingInput" />
                        <label htmlFor="floatingInput">Date de soutenance</label>
                     </div>
                <br />

                <div className="form-floating mb-3 primary">
                <select className="form-select" aria-label="Default select example">                   
                    <option value="1">DEGS</option>
                    <option value="2">UToamasina</option>
                    <option value="3">UFianarantsoa</option>
                </select>
                <button className="btn btn-outline-secondary" type="submit" >Supprimer</button>
                </div>
                <br />
                <br />

                </form>
            </div>

    );
};

export default Ajout;
